"   (For additional information",
"   <a class=\"drug drug_patient\" href=\"mobipreview.htm?19/38/20069?source=see_link\">",
"    see \"Acetaminophen, diphenhydramine, and phenylephrine: Patient drug information\"",
"   </a>",
"   )",
"   <br/>",
"   For abbreviations and symbols that may be used in Lexicomp (",
"   <a class=\"graphic graphic_table\" href=\"mobipreview.htm?23/39/24183\">",
"    show table",
"   </a>",
"   )",
"   <div class=\"list ubnlist drugH1Div drugBrandNames\" id=\"F6816907\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Brand Names: U.S.",
"    </span>",
"    <ul>",
"     <li>",
"      Benadryl&reg; Allergy and Cold [OTC];",
"     </li>",
"     <li>",
"      Benadryl&reg; Allergy and Sinus Headache [OTC];",
"     </li>",
"     <li>",
"      Benadry&reg; Maximum Strength Severe Allergy and Sinus Headache [OTC];",
"     </li>",
"     <li>",
"      Cold Control PE [OTC];",
"     </li>",
"     <li>",
"      One Tab&trade; Allergy &amp; Sinus [OTC];",
"     </li>",
"     <li>",
"      One Tab&trade; Cold &amp; Flu [OTC];",
"     </li>",
"     <li>",
"      Robitussin&reg; Peak Cold Nighttime Multi-Symptom Cold [OTC];",
"     </li>",
"     <li>",
"      Sudafed PE&reg; Nighttime Cold [OTC];",
"     </li>",
"     <li>",
"      Sudafed PE&reg; Severe Cold [OTC];",
"     </li>",
"     <li>",
"      Theraflu&reg; Nighttime Severe Cold &amp; Cough [OTC];",
"     </li>",
"     <li>",
"      Theraflu&reg; Sugar-Free Nighttime Severe Cold &amp; Cough [OTC];",
"     </li>",
"     <li>",
"      Theraflu&reg; Warming Relief&trade; Flu &amp; Sore Throat [OTC];",
"     </li>",
"     <li>",
"      Theraflu&reg; Warming Relief&trade; Nighttime Severe Cold &amp; Cough [OTC];",
"     </li>",
"     <li>",
"      Tylenol&reg; Allergy Multi-Symptom Nighttime [OTC];",
"     </li>",
