"   <div class=\"block pha drugH1Div\" id=\"F6816933\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Acetaminophen inhibits the synthesis of prostaglandins in the central nervous system and peripherally blocks pain impulse generation.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Diphenhydramine is an H",
"     <sub>",
"      1",
"     </sub>",
"     -receptor antagonist.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Phenylephrine causes vasoconstriction of the arterioles of the nasal mucosa.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F6816923\" xmlns=\"file://www.w3.org/1999/xhtml\">",
