var title_f39_37_40538="Basophilic stippling";
var content_f39_37_40538=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F71989%7EHEME%2F73790%7EHEME%2F60588&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F71989%7EHEME%2F73790%7EHEME%2F60588&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Basophilic stippling of red cells in lead poisoning",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 347px; height: 283px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Peripheral blood smear shows basophilic stippling in several red cells from a patient with lead poisoning. The granules represent ribosomal precipitates. A similar picture can be seen in a number of other conditions including thalassemia, megaloblastic anemia, sickle cell anemia, and sideroblastic anemia.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Carola von Kapff, SH (ASCP).",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal peripheral blood smear",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 393px; height: 257px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    High power view of a normal peripheral blood smear. Several platelets (black arrows) and a normal lymphocyte (blue arrow) can also be seen. The red cells are of relatively uniform size and shape. The diameter of the normal red cell should approximate that of the nucleus of the small lymphocyte; central pallor (red arrow) should equal one-third of its diameter.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Carola von Kapff, SH (ASCP).",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Peripheral smear in Heinz body hemolytic anemia showing Heinz bodies and bite cells",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 389px; height: 270px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Split screen view of a peripheral smear from a patient with Heinz body hemolytic anemia. Left panel: red cells with characteristic bite-like deformity (arrows). Right panel: Heinz body preparation which reveals the denatured hemoglobin precipitates.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Carola von Kapff, SH (ASCP).",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal peripheral blood smear",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 393px; height: 257px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    High power view of a normal peripheral blood smear. Several platelets (black arrows) and a normal lymphocyte (blue arrow) can also be seen. The red cells are of relatively uniform size and shape. The diameter of the normal red cell should approximate that of the nucleus of the small lymphocyte; central pallor (red arrow) should equal one-third of its diameter.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Carola von Kapff, SH (ASCP).",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Howell-Jolly bodies following splenectomy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 238px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This peripheral blood smear shows two red blood cells (RBC) that contain Howell-Jolly bodies (black arrows). Howell-Jolly bodies are remnants of RBC nuclei that are normally removed by the spleen. Thus, they are seen in patients who have undergone splenectomy (as in this case) or who have functional asplenia (eg, from sickle cell disease). Target cells (blue arrows) are another consequence of splenectomy.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Carola von Kapff, SH (ASCP).",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal peripheral blood smear",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 393px; height: 257px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    High power view of a normal peripheral blood smear. Several platelets (black arrows) and a normal lymphocyte (blue arrow) can also be seen. The red cells are of relatively uniform size and shape. The diameter of the normal red cell should approximate that of the nucleus of the small lymphocyte; central pallor (red arrow) should equal one-third of its diameter.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Carola von Kapff, SH (ASCP).",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
