var title_f39_37_40539="Initiation of pressure-cycled NPPV in NM disease";
var content_f39_37_40539=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F51437&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F51437&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Protocol for initiation of noninvasive positive pressure ventilation using pressure-cycled ventilator",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td>",
"       1. Choose appropriately monitored location.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       2. Direct patient to sit in bed or chair at &gt;30 angle. Ensure patient comfort.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       3. Obtain baseline vital signs, arterial blood gas, and oximetry, as clinically indicated.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       4. Select and fit interface (nasal or oronasal mask).",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       5. Apply headgear; avoid excessive strap tension (one or two fingers under strap).",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       6. Select ventilator.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       7. Connect interface to ventilator tubing and turn on ventilator.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       8. For pressure-cycled ventilator, start with low pressure in spontaneously triggered mode; pressure limited: inspiratory pressure (IPAP) 8 to 10 cm H2O; expiratory pressure (EPAP) 4 to 5 cm H2O. A back up rate of 2 breaths per minute below the patient's spontaneous nocturnal rate.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       9. Gradually increase inspiratory pressure by 2.5 cm H2O increments, as tolerated, to achieve alleviation of dyspnea, decreased respiratory rate, increased tidal volume (if being monitored), and good patient-ventilator synchrony.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       10. Check for air leaks, readjust straps as needed. Add chin strap, if oral air leak noted.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       11. Add heated humidification, as indicated.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       12. Provide encouragement, reassurance, and frequent checks and adjustments as needed.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       13. Monitor vital signs and oximetry during trial; obtain occasional blood gases (within 1 to 2 hours) and then as needed.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
